import React, { Component } from 'react';

class Counter extends Component {
    state = { 
        count : 15,
        seconds : 60,
        interval : 10,
        bpm : {
            previous_bpm : 0,
            new_bpm : 0
        }
        };

    render() { 
        return (
        <React.Fragment className="counter_button" id="counter_button">
            <span>{this.state.count /60}</span>
            <button>Increment</button>
        </React.Fragment>
        );
    }
}

export default Counter;
